let _baseurl = "";
// let _baseurl = "";
export default [
  {
    path: `${_baseurl}/index`,
    name: "index",
    component: () => import("@/pages/index")
  },
  {
    path: `${_baseurl}/VueWorks`,
    name: "VueWorks",
    component: () => import("@/pages/VueWorks")
  },
  {
    path: `${_baseurl}/ChangeName`,
    name: "ChangeName",
    component: () => import("@/pages/ChangeName")
  },
  {
    path: `${_baseurl}/Contact`,
    name: "Contact",
    component: () => import("@/pages/Contact")
  },
  {
    path: "*",
    // redirect: "/index"
    component: () => import("@/pages/index")
  }
  // {
  //   path: "*",
  //   component: () => import("@/pages/index")
  // }
];
